You can take this one step further by breaking the code into multiple files. Imagine each class you define in it's own file.

Do this by moving the MyClass code into a new file inside the src directory. I named the new file my-scene.js. There three changes, find them. Line 1 imports Scene from phaser.  Line 3 uses Scene rather than Phaser.Scene, due to the previous change, the last line exports this class, this allows you to import the class.

```import { Scene } from 'phaser'

class MyScene extends Scene {
    constructor() {
        super()

        this.myVar = 99
    }

    preload() {
        this.load.image('logo', 'assets/Alien-1_1.png');
    }

    create() {
        var logo = this.add.image(200, 150, 'logo');

        this.tweens.add({
            targets: logo,
            y: 350,
            duration: 2000,
            ease: 'Power2',
            yoyo: true,
            loop: -1
        });
    }
}

export default MyScene```

Now change index.js. Here you will modify the import statement at the top. To import Game from Phaser, this allows you to change the last line to new Game rather than new Phaser.Game. Also, you'll import your MyClass that you exported in the my-class.js file on line 2.

```import { Game } from 'phaser';
import MyScene from './my-scene'

var config = {
    type: Phaser.AUTO,
    parent: 'phaser-example',
    width: 400,
    height: 400,
    scene: new MyScene()
};

var game = new Game(config);```

Notes from class. Extend Phaser.Scene to create a Scene. The original code showing the functions that were used to build the scene are in a comment at the bottom.

